import React, { Component } from 'react';

class Ninja extends Component{
render(){
    console.log(this.props);
    return(
        <div className= "ninja">
            <div>Name: {this.props.name}</div>
            <div>Age: {this.props.age}</div>
            <div>Belt: {this.props.belt}</div>
        </div>
    )
}
}

export default Ninja;
